INSERT INTO `#__content` VALUES 
(71,174,'Typography','typography','<p> </p>\r\n<h3 class="jm-typo-title">CSS3 animated hover effects for images</h3>\r\n<p>This code allows you to display an image and its description with animated CSS3 effect.<br /><strong>Note:</strong> If you would like to add your own text into the image description, just modify the code below or edit an existing code in the custom module of the demo template.</p>\r\n<p> </p>\r\n<div class="clearfix">\r\n<div style="float: left; width: 49%;">\r\n<div class="padding: 0 10px 0 0;">\r\n<p><strong>Example 1</strong></p>\r\n<div class="jm-code">&lt;div class="dj-image-hover"&gt;<br />&lt;div class="view view-third"&gt;<br />&lt;img src="images/modules/<strong>delivery.png</strong>" /&gt;<br />&lt;div class="mask"&gt;<br />&lt;h2&gt;<strong>Title</strong>&lt;/h2&gt;<br />&lt;p&gt;<strong>Lorem ipsum.</strong>&lt;/p&gt;<br />&lt;a class="readmore" href="#"&gt;<strong>Read More</strong>&lt;/a&gt;&lt;/div&gt;<br />&lt;/div&gt;<br />&lt;/div&gt;</div>\r\n<p> </p>\r\n<div class="dj-image-hover">\r\n<div class="view view-third"><img src="images/modules/delivery.png" alt="" border="0" />\r\n<div class="mask">\r\n<h2>Title</h2>\r\n<p>Lorem ipsum.</p>\r\n<a class="readmore" href="#">Read More</a></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div style="float: right; width: 49%;">\r\n<div class="padding: 0 0 0 10px;">\r\n<p><strong>Example 2</strong></p>\r\n<div class="jm-code">&lt;div class="dj-image-hover"&gt;<br />&lt;div class="view view-fifth"&gt;<br />&lt;img src="images/modules/<strong>guarantee.png</strong>" /&gt;<br />&lt;div class="mask"&gt;<br />&lt;h2&gt;<strong>Title</strong>&lt;/h2&gt;<br />&lt;p&gt;<strong>Lorem ipsum.</strong>&lt;/p&gt;<br />&lt;a class="readmore" href="#"&gt;<strong>Read More</strong>&lt;/a&gt;&lt;/div&gt;<br />&lt;/div&gt;<br />&lt;/div&gt;</div>\r\n<p> </p>\r\n<div class="dj-image-hover">\r\n<div class="view view-fifth"><img src="images/modules/guarantee.png" alt="" border="0" />\r\n<div class="mask">\r\n