>Read More</a></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p> </p>\r\n<h3 class="jm-typo-title">Custom Categories</h3>\r\n<p><strong>Note:</strong> If you remove the "jm-rounded" class, you will get the squares instead of the circles. This can be helpful if you have some longer category names.</p>\r\n<p> </p>\r\n<div class="jm-code" style="margin: 0 0 20px;">&lt;div class="jm-custom-categories jm-box3 <strong>jm-rounded</strong>"&gt;<br />&lt;div class="jm-custom-box"&gt;<br />&lt;div class="jm-custom-box-in"&gt;<br />&lt;h2&gt;&lt;a href="#"&gt; &lt;img src="images/modules/categories/<strong>women.png</strong>" alt="women" /&gt; &lt;span class="category-name"&gt;<strong>Women</strong>&lt;/span&gt; &lt;/a&gt;&lt;/h2&gt;<br />&lt;/div&gt;<br />&lt;/div&gt;<br />&lt;div class="jm-custom-box"&gt;<br />&lt;div class="jm-custom-box-in"&gt;<br />&lt;h2&gt;&lt;a href="#"&gt; &lt;img src="images/modules/categories/<strong>men.png</strong>" alt="men" /&gt; &lt;span class="category-name"&gt;<strong>Men</strong>&lt;/span&gt; &lt;/a&gt;&lt;/h2&gt;<br />&lt;/div&gt;<br />&lt;/div&gt;<br />&lt;div class="jm-custom-box"&gt;<br />&lt;div class="jm-custom-box-in"&gt;<br />&lt;h2&gt;&lt;a href="#"&gt; &lt;img src="images/modules/categories/<strong>kids.png</strong>" alt="kids" /&gt; &lt;span class="category-name"&gt;<strong>Kids</strong>&lt;/span&gt; &lt;/a&gt;&lt;/h2&gt;<br />&lt;/div&gt;<br />&lt;/div&gt;<br />&lt;/div&gt;</div>\r\n<div class="jm-custom-categories jm-box3 jm-rounded">\r\n<div class="jm-custom-box">\r\n<div class="jm-custom-box-in">\r\n<h2><a href="#"> <img src="images/modules/categories/women.png" alt="women" border="0" /> <span class="category-name">Women</span> </a></h2>\r\n</div>\r\n</div>\r\n<div class="jm-custom-box">\r\n<div class="jm-custom-box-in">\r\n<h2><a href="#"> <img src="images/modules/categories/men.png" alt="men" border="0" /> <span class="category-name">Men</span> </a></h2>\r\n</div>\r\n</div>\r\n<div class="jm-custom-box">\r\n<div class="jm-custom-box-in">\r\n<h2><a href="#"> <img src="images/modules/categories/kids.png" alt="kids" border="0" /> <span class="category-name">Kids</span> </a></h2>\r\n</div>\r\n</div>\r\n</div>\r\n<p> </p>\r\n<h3 class="jm-typo-title">Custom Slide</h3>\r\n<p>This custom code you can use in a custom html module or as custom description for DJ-MediaTools slides.</p>\r\n<p> </p>\r\n<div class="jm-code" style="margin: 0 0 20px;">&lt;p&gt;&lt;a href="#"&gt;&lt;img src="images/modules/top/<strong>dress1.jpg</strong>" alt="Cotton Dress" /&gt;&lt;/a&gt;&lt;/p&gt;<br />&lt;div class="jm-custom-slide"&gt;<br />&lt;h3&gt;&lt;a href="#"&gt;<strong>Cotton Dress</strong>&lt;/a&gt;&lt;/h3&gt;<br />&lt;span class="jm-slide-price"&gt;<strong>$75</strong>&lt;/span&gt;<br />&lt;span class="jm-slide-desc"&gt;<strong>offer valid until March 20th</strong>&lt;/span&gt;<br />&lt;p&gt;&lt;a class="readmore" href="#"&gt;<strong>Readmore</strong>&lt;/a&gt;&lt;/p&gt;<br />&lt;/div&gt;</div>\r\n<div style="width: 300px; max-width: 100%; margin: 0 auto;">\r\n<p><a href="#"><img src="images/modules/top/dress1.jpg" alt="Cotton Dress" border="0" /></a></p>\r\n<div class="jm-custom-slide">\r\n<h3><a href="#">Cotton Dress</a></h3>\r\n<span class="jm-slide-price">$75</span> <span class="jm-slide-desc">offer valid until March 20th</span>\r\n<p><a class="readmore" href="#">Readmore</a></p>\r\n</div>\r\n</div>\r\n<p> </p>\r\n<h3 class="jm-typo-title">Custom Discount</h3>\r\n<div class="jm-code" style="margin: 0 0 20px;">&lt;div class="jm-custom-discount"&gt;<br />&lt;div class="jm-custom-left"&gt;&lt;img src="images/modules/<strong>model.jpg</strong>" alt="Model" /&gt;&lt;/div&gt;<br />&lt;div class="jm-custom-right"&gt;<br />&lt;p&gt;&lt;img src="images/modules/<strong>more-or-less.png</strong>" alt="More or Less" /&gt;&lt;/p&gt;<br />&lt;h3&gt;<strong>Get 15%</strong>&lt;span class="jm"&gt;<strong>discount</strong>&lt;/span&gt;&lt;/h3&gt;<br />&lt;span class="jm"&gt;<strong>For all dresses, till March 20th</strong>&lt;/span&gt;<br />&lt;p&gt;&lt;a class="readmore2" href="#"&gt;<strong>Check it!</strong>&lt;/a&gt;&lt;/p&gt;<br />&lt;/div&gt;<br />&lt;/div&gt;</div>\r\n<div style="width: 440px; max-width: 100%; margin: 0 auto;">\r\n<div class="jm-custom-discount">\r\n<div class="jm-custom-left"><img src="images/modules/model.jpg" alt="Model" border="0" /></div>\r\n<div class="jm-custom-right">\r\n<p><img src="images/modules/more-or-less.png" alt="More or Less" border="0" /></p>\r\n<h3>Get 15%<span class="jm">discount</span></h3>\r\n<span class="jm">For all dresses, till March 20th</span>\r\n<p><a class="readmore2" href="#">Check it!</a></p>\r\n</div>\r\n</div>\r\n</div>\r\n<p> </p>','',1,82,'2013-02-20 09:05:10',794,'','2014-06-29 10:15:14',61,0,'0000-00-00 00:00:00','2013-02-20 09:05:10','0000-00-00 00:00:00','{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}','{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}','{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}',55,17,'','',1,211,'{"robots":"","author":"","rights":"","xreference":""}',0,'*',''),
(84,206,'Template Layout','template-layout','<p><a title="JM Modern Store" href="https://www.joomla-monster.com/all-templates/i/22-ecommerce/112-jm-modern-store" target="_blank">JM Modern Store</a> Joomla template uses fully responsive layout that adjusts to various screens: desktops, tablets or mobiles.<br />The template uses default width values specified at <a title="Template layout positions" href="http://www.joomla-monster.com/index.php?option=com_content&amp;view=article&amp;id=609:framework-ver-ef-3-0&amp;catid=100&amp;Itemid=839" target="_blank">the template configuration</a>.</p>\r\n','\r\n<p> </p>\r\n<h4>Template layout positions for desktop &amp; tablet - landscape orientation</h4>\r\n<p><br /><img class="border_img" style="display: block; margin-left: auto; margin-right: auto;" title="Template modules positions for desktop, tablet orientation" src="images/modules/features/positions-desktop.jpg" alt="positions-desktop" border="0" /></p>\r\n<p> </p>\r\n<h4>Template layout positions for tablets - portrait orientation</h4>\r\n<p><br /><img class="border_img" style="display: block; margin-left: auto; margin-right: auto;" title="Template layout positions for tablets - prtrait orientation" src="images/modules/features/positions-tablet.jpg" alt="positions-tablet" border="0" /></p>\r\n<p style="text-align: center;"> </p>\r\n<h4>Template layout positions for mobiles</h4>\r\n<p><br /><img class="border_img" style="display: block; margin-left: auto; margin-right: auto;" title="Template layout positions for mobiles" src="images/modules/features/positions-mobile.jpg" alt="positions-mobile" border="0" /></p>',1,82,'2013-11-19 09:38:06',794,'','2015-01-20 09:47:10',743,0,'0000-00-00 00:00:00','2013-11-19 09:38:06','0000-00-00 00:00:00','{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}','{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}','{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}',12,15,'','',1,35,'{"robots":"","author":"","rights":"","xreference":""}',0,'*',''),
(85,207,'Module Suffixes','module-suffixes','<p>There are 5 available module designs that you can control by entering the correct suffix name to a module parameter. There are also additional suffixes for other modules and pages.<br />Let\'s check them all.</p>\r\n','\r\n<p> </p>\r\n<h4>1. Available module designs for the pink template version.</h4>\r\n<p> </p>\r\n<p><img class="border_img" title="Module designs for the pink template version" src="images/modules/features/pink-suffixes.jpg" alt="pink-suffixes" border="0" /></p>\r\n<p> </p>\r\n<h4>2. Available module designs for the blue template version.</h4>\r\n<p> </p>\r\n<p><img class="border_img" title="Module designs for the blue template version" src="images/modules/features/blue-suffixes.jpg" alt="blue-suffixes" border="0" /></p>\r\n<p> </p>\r\n<h4>3. Available module designs for the green template version.</h4>\r\n<p> </p>\r\n<p><img class="border_img" title="Module designs for the green template version" src="images/modules/features/green-suffixes.jpg" alt="green-suffixes" border="0" /></p>\r\n<p> </p>\r\n<h4>4. Available menu designs for the pink template version. <br />The "brackets" or "vertical" class should be added as the menu class suffix in a module parameter.</h4>\r\n<p> </p>\r\n<p><img class="border_img" title="Menu designs for the pink template version" src="images/modules/features/pink-menu.jpg" alt="pink-menu" border="0" /></p>\r\n<p> </p>\r\n<h4>5. Available menu designs for the blue template version. <br />The "brackets" or "vertical" class should be added as the menu class suffix in a module parameter.</h4>\r\n<p> </p>\r\n<p><img class="border_img" title="Menu designs for the blue template version" src="images/modules/features/blue-menu.jpg" alt="blue-menu" border="0" /></p>\r\n<p> </p>\r\n<h4>6. Available menu designs for the green template version. <br />The "brackets" or "vertical" class should be added as the menu class suffix in a module parameter.</h4>\r\n<p> </p>\r\n<p><img class="border_img" title="Menu designs for the green template version" src="images/modules/features/green-menu.jpg" alt="green-menu" border="0" /></p>\r\n<p> </p>\r\n<h4>7. Use this module suffix for the Joomla search module if you want to get the following view.<br />Otherwise the module will use the default CSS styles.</h4>\r\n<p> </p>\r\n<p><img class="border_img" title="jm-search" src="images/modules/features/jm-search.jpg" alt="jm-search" border="0" /></p>\r\n<p><br /><strong>Suffix name:</strong> jm-search</p>\r\n<p> </p>\r\n<h4>8. Use this page class suffix for the Joomla contact form if you want to get the following view.<br />Otherwise the contact form will use the default CSS styles.</h4>\r\n<p> </p>\r\n<p><img class="border_img" title="contact-ps" src="images/modules/features/contact-ps.jpg" alt="contact-ps" border="0" /></p>\r\n<p><br /><strong>Suffix name:</strong> contact-ps</p>\r\n<p> </p>\r\n<h4>9. Use this module suffix for the VirtueMart Cart module if you want to get the following view.<br /> Otherwise the module will use the default CSS styles.</h4>\r\n<p> </p>\r\n<p><img class="border_img" title="cart-ms" src="images/modules/features/cart-horizontal.jpg" alt="cart-horizontal" border="0" /></p>\r\n<p><br /><strong>Suffix name:</strong> cart-horizontal</p>\r\n<p> </p>\r\n<h4>10. Use this module suffix for the VirtueMart Products module if you want to get the following view.<br /> Otherwise the module will use the default CSS styles.</h4>\r\n<p> </p>\r\n<p><img class="border_img" title="vm-animated-products" src="images/modules/features/vm-animated-products.jpg" alt="vm-animated-products" border="0" /></p>\r\n<p><br /><strong>Suffix name:</strong> vm-animated-products</p>\r\n<p> </p>\r\n<h4>11. Use this module suffix for the DJ-MediaTools Album module if you want to get the following view.<br />Otherwise the module will use the default CSS styles.</h4>\r\n<p> </p>\r\n<p><strong>Please note!</strong> You need to use the custom code to get the same look for the slide description. More details you will find in the "Typography" article <a title="Typography" href="index.php?option=com_content&amp;view=article&amp;id=71&amp;Itemid=519">here</a>.</p>\r\n<p> </p>\r\n<p><img class="border_img" title="slider-ms" src="images/modules/features/slider-ms.jpg" alt="slider-ms" border="0" /></p>\r\n<p><br /><strong>Suffix name:</strong> slider-ms pagination-ms</p>\r\n<p> </p>\r\n<h4>12. Use this module suffix for the DJ-MediaTools Album module if you want to get the following view of the navigation arrows.</h4>\r\n<p> </p>\r\n<p><img class="border_img" title="navigation-ms" src="images/modules/features/navigation-ms.jpg" alt="navigation-ms" border="0" /></p>\r\n<p><br /><strong>Suffix name:</strong> navigation-ms</p>\r\n<p> </p>\r\n<h4>13. Use this module suffix for the DJ-MediaTools Album module if you want to get the following view of the navigation arrows.</h4>\r\n<p> </p>\r\n<p><strong>Please note!</strong> This module suffix will work on the following layouts: modern slider, slideshow, slideshow with thumbnails and tabber.</p>\r\n<p> </p>\r\n<p><img class="border_img" title="sides-ms" src="images/modules/features/sides-ms.jpg" alt="sides-ms" border="0" /></p>\r\n<p><br /><strong>Suffix name:</strong> navigation-ms sides-ms</p>\r\n<p> </p>\r\n<h4>14. Use this module suffix for the DJ-MediaTools Album module if you want to get the following view.</h4>\r\n<p> </p>\r\n<p><strong>Please note!</strong> This module uses the VirtueMart Products as source.</p>\r\n<p> </p>\r\n<p><img class="border_img" title="hikashop-ms" src="images/modules/features/virtuemart-ms.jpg" alt="virtuemart-ms" border="0" /></p>\r\n<p><br /><strong>Suffix name:</strong> virtuemart-ms</p>\r\n<p> </p>\r\n<h4>15. Additional and very useful suffix to make your modules\' height the same.</h4>\r\n<p> </p>\r\n<p>You just have to put a suffix at a module configuration to get the specified module height. <br />See here the screenshot:</p>\r\n<p> </p>\r\n<p><img class="border_img" title="Module height" src="images/modules/features/height1.jpg" alt="height1" width="381" height="198" border="0" /></p>\r\n<p> </p>\r\n<p><strong>_mod300</strong> means that your module will be of 300 pixels high.<br /><br />If you need to mix suffixes, remember to put that suffix at the end and add space between suffixes, see the example:</p>\r\n<p> </p>\r\n<p><img src="images/modules/features/height2.jpg" alt="height2" width="388" height="194" border="0" /></p>',1,82,'2013-11-19 09:39:13',794,'','2014-12-29 15:39:26',743,0,'0000-00-00 00:00:00','2013-11-19 09:39:13','0000-00-00 00:00:00','{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}','{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}','{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}',18,16,'','',1,53,'{"robots":"","author":"","rights":"","xreference":""}',0,'*',''),
